import binascii, zlib

def export_isp_bin():
        ISP_PROG = ''

        ISP_PROG = binascii.unhexlify(ISP_PROG)
        ISP_PROG = zlib.decompress(ISP_PROG)

        with open("K210_ISP.bin", "wb") as f:
            f.write(ISP_PROG)
        print("---------")

if __name__ == "__main__":
    export_isp_bin()
